import Table from "./UI/Table";

const CreateTable = ({ userList, remove, sort }) => {
  const renderList = userList.map((user, index) => (
    <tr key={user.id}>
      <td>{index + 1}</td>
      <td>{user.name}</td>
      <td>{user.age}</td>
      <td>
        <button onClick={() => remove(user)}>del</button>
      </td>
    </tr>
  ));

  return (
    <Table>
      <thead>
        <tr>
          <th>
            <button>Number</button>
          </th>
          <th>
            {" "}
            <button>Name</button>
          </th>
          <th colSpan={2}>
            {" "}
            <button
              style={{ border: "none", backgroundColor: "rgba(237,237,237)" }}
            >
              Age
            </button>
          </th>
        </tr>
      </thead>
      <tbody>{renderList}</tbody>
    </Table>
  );
};

export default CreateTable;
